jQuery.fn.dataTable.ext.type.order["file-size-pre"]=function(data){var matches=data.match(/^(\d+(?:\.\d+)?)\s*([a-z]+)/i);var multipliers={b:1,bytes:1,kb:1e3,kib:1024,mb:1e6,mib:1048576,gb:1e9,gib:1073741824,tb:1e12,tib:1099511627776,pb:1e15,pib:0x4000000000000};if(matches){var multiplier=multipliers[matches[2].toLowerCase()];return parseFloat(matches[1])*multiplier}else{return-1}};function rendererFilesize(data,type,row){if(data==null)return"0 b";if(data<1e3)return data+" b";if(data<1e3*1e3){data=data/1e3;return data.toFixed(2)+" Kb"}if(data<1e3*1e3*1e3){data=data/(1e3*1e3);return data.toFixed(2)+" Mb"}if(data<1e3*1e3*1e3*1e3){data=data/(1e3*1e3*1e3);return data.toFixed(2)+" Gb"}if(data<1e3*1e3*1e3*1e3*1e3){data=data/(1e3*1e3*1e3*1e3);return data.toFixed(2)+" Tb"}}